  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the caribou distribution
  and abundance data through the fall of 1989. Results of a literature review prior
  to preparation of the Refuge caribou inventory plan are presented below as background.
  Survey results are presented in four separate sections: distribution, abundance,
  Waring Mountains Burn, and radio-telemetry. A description of the study area, methods
  used, and a discussion of the results is covered. Management recommendations are
  also included. Maps of the study area are attached.\",\n\t\"license_title\": \"License
